import React from 'react';
import { Nav, Navbar, Form, FormControl } from 'react-bootstrap';
import styled from 'styled-components';
const Styles = styled.div`
  .navbar { background-color: #222; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .form-center {
    position: absolute !important;
    left: 25%;
    right: 25%;
  }
`;
export default function NavigationBar(){
    return (
        <>
<Router>
  <div>      
  <Styles>
    <Navbar expand="lg">
      <Navbar.Brand href="/">SolidMusic</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav"/>
      <Form className="form-center">
        <FormControl type="text" placeholder="Search" className="" />
      </Form>
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Item><Nav.Link exact activeClassName="selected" to="/">Home</Nav.Link></Nav.Item> 
          <Nav.Item><Nav.Link exact activeClassName="selected" to="/Endpoint1">About</Nav.Link></Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </Styles>

<div className="content"></div>
<Switch>
  <Route exact path="/">
    <Home />
  </Route>
  <Route path="/Endpoint1">
    <Endpoint1 />
  </Route>
</Switch>
</div>
</Router>
</>
)

function Home() {
    return (
      <div>
        <h2>Home</h2>
        <p>We got 4 different endpoints wich can be selected in the different tabs in the navbar</p>
      </div>
    );
  }
  function Endpoint1() {
    return (
      <div>
        <h2>All persons</h2>
      </div>
    );
  }
}

export {NavigationBar};
